    function processCallData(bytes memory callData) public pure returns (string memory) {
        // Decode the call data using ethers.js
        (bytes4 selector, ) = abi.decode(callData, (bytes4, bytes));

        // Get the function name from the selector
        string memory functionName = abi.decode(bytes4ToString(selector), (string));

        return functionName;
    }

    // Utility function to convert bytes4 to string
    function bytes4ToString(bytes4 data) private pure returns (bytes memory) {
        bytes memory bytesString = new bytes(32);
        for (uint256 i; i < 4; i++) {
            bytes1 char = bytes1(bytes4(uint32(0xFF000000) >> (i * 8)));
            bytesString[i] = char;
        }
        return bytesString;
    }
